import classes from "./Dialogue.module.css"

const Dialogue = () => {
    return(
      <div className={classes.alldialogues}>
          <div className={classes.block}>Vlad</div>
          <div className={classes.block}>Andriy</div>
      </div>
    );
}

export default Dialogue;
